MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "List of Figures");
MGCAddSnippet(3, "List of Tables");
MGCAddSnippet(4, "");
MGCAddSnippet(5, "Calibre Pattern Matching in physical verification is the process of locating specific polygons in a design from a user-specified pattern. You can use Calibre Pattern Matching to simplify certain CalibrenmDRC rule checks which are complex to code in Standard Verification Rule Format (SVRF) syntax. Rule file development time may also be shortened when existing rule files are combined with Calibre Pattern Matching.");
MGCAddSnippet(6, "Pattern matching enables you to find targeted patterns for special Calibre nmDRC checks and identify known lithographic problem areas.");
MGCAddSnippet(7, "The major components of Calibre Pattern Matching simplify complex rule checks required for advanced IC processes by replacing text-based design rule checks with a visual geometry.");
MGCAddSnippet(8, "There are licensing and environment variable requirements for the Calibre Pattern Matching tool. ");
MGCAddSnippet(9, "This section provides some guidelines for running Calibre Pattern Matching.");
MGCAddSnippet(10, "Topological pattern matching in physical verification is used to find targeted placements of polygons, misaligned polygons, lithographic hotspots, and DRC rule checks that are difficult to code using SVRF syntax.");
MGCAddSnippet(11, "The command descriptions use font properties and several metacharacters to document the command syntax.");
MGCAddSnippet(12, "Several key principles and concepts pertain to pattern matching. ");
MGCAddSnippet(13, "A collection of patterns is stored in a Pattern Matching Database (PMDB), also called a pattern library. ");
MGCAddSnippet(14, "There are several restrictions and guidelines for all pattern libraries.");
MGCAddSnippet(15, "You can merge two or more pattern libraries into one library. The merging process removes patterns that are duplicates. Combining libraries is useful because it reduces the number of pattern matching calls. However, care must be taken that the libraries being merged have the same layer list. ");
MGCAddSnippet(16, "A pattern defines the basic structure of the polygons Calibre searches for in a pattern matching run.");
MGCAddSnippet(17, "There are two types of vertices: real and virtual. Overlapping vertices are allowed in TEM patterns, but they have special considerations. ");
MGCAddSnippet(18, "An edge is the line segment between two vertices. There are three types of pattern edges: real, partial, and virtual.");
MGCAddSnippet(19, "Topological Edge Match (TEM) patterns are the default pattern type. ");
MGCAddSnippet(20, "Barcode Match (BCM) patterns are used to find one-dimensional or barcode-like patterns. In contrast to TEM patterns, BCM patterns have only four unique orientations. ");
MGCAddSnippet(21, "Crossbar patterns are multilayer patterns in which each layer is a BCM pattern and edges on at least two of the layers are perpendicular to each other. They have no real vertexes.");
MGCAddSnippet(22, "Some pattern features are only supported for certain pattern types. ");
MGCAddSnippet(23, "Calibre Pattern Matching enables you to group similar patterns into clusters. Clustering can be performed using either the Calibre Pattern Matching GUI or the pdl_lib_mgr cluster utility.");
MGCAddSnippet(24, "Different layers are generated at various stages of pattern library development.");
MGCAddSnippet(25, "The extent layer defines the borders of the pattern and isolates the pattern from surrounding geometries. For TEM patterns, you can define multiple extents, including an extent for the pattern as a whole and extents for individual layers. BCM and XBAR patterns have a single, rectangular extent.");
MGCAddSnippet(26, "The default pattern extent is a minimum bounding box that encloses all polygons and constraints in the pattern. A default pattern extent is created automatically by the Calibre Pattern Matching GUI.");
MGCAddSnippet(27, "A custom extent is a polygonal boundary that is defined for the pattern as a whole or for a specific layer. A custom extent enables a different extent shape than the default extent, which is the pattern bounding box. Polygons outside the custom extent are not considered in the matching process, therefore custom extents enable more control over the region that is matched than is possible with the default extent. Custom extents can be considered as a way to define a Don t Care region. ");
MGCAddSnippet(28, "A pattern extent is a polygon that defines the limits of a pattern. Dynamic extents shrink or expand in size with a constrained pattern edge. Dynamic extents are defined using the Calibre Pattern Matching GUI. ");
MGCAddSnippet(29, "Marker layers are output layers generated by the pattern matching tool. The shapes on the marker layer indicate the locations of pattern matches. The typical practice is to output the marker layer to the results database and/or a DFM RDB file.");
MGCAddSnippet(30, "The possible marker types for TEM and XBAR patterns are BBox10, BBox, Custom, Drawn, Empty, and Matched. These markers return results for each matched pattern.");
MGCAddSnippet(31, "The possible marker types for BCM patterns are Custom, Empty, Matched, BBox, and BBox10. ");
MGCAddSnippet(32, "You can add count markers to the results from a pattern matching run. Count markers are small, non-overlapping markers for each matched result. They can be used to determine a count of matched results. Count markers are added when you compile a pattern library. ");
MGCAddSnippet(33, "For symmetric patterns with an asymmetric marker, pattern matching may return two or more results, signifying more than one match for the same shape because the tool finds all possible rotations and mirrors of a pattern. ");
MGCAddSnippet(34, "Region layers have special matching properties. A region layer is associated with a specific pattern layer and enables the definition of special areas within a pattern. ");
MGCAddSnippet(35, "Don t Care regions are unique layers that define a region that is ignored during the matching process. Don t Care regions are associated with a particular pattern layer. ");
MGCAddSnippet(36, "Critical regions are unique layers that require a minimum of one polygon, of any shape, to exist within the region layer for a successful match during the matching process. Critical regions are associated with a particular pattern layer. ");
MGCAddSnippet(37, "A Keep Out region is an area that must not have any polygons inside it. ");
MGCAddSnippet(38, "When regions overlap, the criteria for each region must be met. ");
MGCAddSnippet(39, "Geometries on Don t Care pattern layers are ignored during the matching process. Don t Care layers can be added to a library so that two or more libraries have the same number and order of layers, which is required by the merge utility. ");
MGCAddSnippet(40, "Multilayer patterns can include full and empty pattern layers, but at least one layer that is not full, empty, or a Don t Care layer is required. ");
MGCAddSnippet(41, "Constraints enable you to specify the distance an edge can shift and still be considered a match. Constraints allow for variations in the pattern when Calibre searches for pattern matches. Constraints are specified in the Calibre Pattern Matching GUI. ");
MGCAddSnippet(42, "A global constraint specifies an allowed movement for all real edges in a pattern. Global constraints can be applied to TEM patterns and single-layer BCM patterns. For TEM patterns, you can apply a global constraint to the whole pattern or to selected pattern layers. ");
MGCAddSnippet(43, "Edge to edge constraints specify the allowed separation between two parallel edges. Edge to edge constraints can be specified between a pattern edge and another pattern edge, between a pattern edge and a custom extent edge, or between a pattern edge and a custom marker edge.");
MGCAddSnippet(44, "Non-directional edge to edge constraints are useful in patterns in which the relative position (left/right or up/down) of two moving pattern edges does not matter, but there is a constraint on the absolute value of the edge separation. ");
MGCAddSnippet(45, "Edge to edge constraints in BCM2 patterns specify the allowed separation of two edges, where at least one of the edges must have a single edge constraint. The pattern extent remains fixed as the edges move.");
MGCAddSnippet(46, "Edge to edge constraints in BCM1 patterns specify the allowed separation of two edges. The pattern extent shrinks or expands as the edges move. ");
MGCAddSnippet(47, "Marker constraints specify the location of a custom marker edge in relation to a pattern edge that can move. Marker constraints are only allowed in TEM patterns. They are specified as an edge to edge constraint from a custom marker edge to one or two constrained pattern edges. ");
MGCAddSnippet(48, "Relational constraints specify a relation between two edge to edge measurements. For example, two polygons may have variable widths, but require the same width for a successful pattern match. ");
MGCAddSnippet(49, "Pattern constraints that extend past the pattern extent can cause matches to be missed. ");
MGCAddSnippet(50, "An attribute can be given to a pattern or group of patterns prior to using the pattern matching tool. A key is an alphanumeric string attribute that can be used to filter out patterns from the pattern library. Patterns can also be filtered by pattern orientation. Pattern comments can be helpful in providing information to other users about a particular pattern.");
MGCAddSnippet(51, "Properties can be assigned to patterns to enhance the output capabilities of Calibre Pattern Matching.");
MGCAddSnippet(52, "Reserved property names used internally by the Calibre Pattern Matching tool. The property value is assigned during a pattern matching run. ");
MGCAddSnippet(53, "An attribute is string or numeric data associated with the pattern library. Attributes are not used in a pattern matching run and are not attached to pattern matching results. ");
MGCAddSnippet(54, "Keys are optional pattern attributes that allow you to select a subset of patterns to pass to the pattern matching tool for matching.");
MGCAddSnippet(55, "Pattern comments are optional pattern attributes that allow you to add and save text along with your pattern.");
MGCAddSnippet(56, "Pattern orientation settings are optional pattern attributes that define the allowed orientations of a pattern match.");
MGCAddSnippet(57, "You can specify a jog tolerance for all patterns in a library. Jogs within the specified tolerance are ignored in both the pattern and the layout.");
MGCAddSnippet(58, "Most precision differences between a pattern, the layout being matched, and the rule file are handled automatically during a pattern matching run. If the precisions differ, the pattern coordinates are automatically adjusted so that the matching behavior is correct. ");
MGCAddSnippet(59, "A DMACRO file defines the patterns in a pattern library in a format that can be included in the SVRF rule file. The CMACRO command runs pattern matching on the DMACRO library and generates output layers corresponding to the output markers in the pattern library. ");
MGCAddSnippet(60, "The Calibre Pattern Matching GUI provides a way to build and edit a pattern library for a Calibre Pattern Matching run. You can also run certain library utilities, such as merge and compile, from the GUI. ");
MGCAddSnippet(61, "The Calibre Pattern Matching GUI provides an interface for viewing and customizing pattern libraries. This section discusses invocation, basic setup, and GUI components. ");
MGCAddSnippet(62, "You invoke the Calibre Pattern Matching GUI from the command line or from a Calibre layout viewer. ");
MGCAddSnippet(63, "The Calibre Pattern Matching GUI enables you to view and edit patterns in a library. You can also run pattern library utilities, such as merge and compile. ");
MGCAddSnippet(64, "You use the drawing toolbar to draw pattern shapes, custom markers, and custom layer extents. ");
MGCAddSnippet(65, "For some actions you can select multiple patterns in the pattern list and apply the same operation to the selected patterns. ");
MGCAddSnippet(66, "You can set editor preferences such as the grid style and background color. You can also set ruler preferences and license timeout. Preferences are saved when you close the GUI and restored when you start your next session. ");
MGCAddSnippet(67, "Most toolbar button in the Calibre Pattern Matching GUI have a keyboard shortcut, or hotkey. ");
MGCAddSnippet(68, "You can create a pattern library (PMDB) using the Calibre Pattern Matching GUI. You can also perform certain operations on the library, such as merging, compiling, and running pattern matching. ");
MGCAddSnippet(69, "You can create a new pattern matching database (PMDB) from the Calibre Pattern Matching GUI.");
MGCAddSnippet(70, "Jog tolerance is specified at the library level and applies to all pattern edges by default. You can select individual TEM pattern edges and disable jog tolerance for that edge. When jog tolerance is specified for an edge, jogs in the pattern or layout that are within the tolerance are ignored during pattern matching. ");
MGCAddSnippet(71, "You can filter a library based on pattern names, properties, and keys. You can save the filtered patterns in a new library. ");
MGCAddSnippet(72, "You can merge two or more pattern libraries into one library using the Calibre Pattern Matching GUI. Merging removes duplicate patterns. By default, patterns are considered duplicate if the pattern shape, constraints, layer extents, regions, and markers are identical. ");
MGCAddSnippet(73, "You can run pattern matching on a layout using the Calibre Pattern Matching GUI. The tool builds the appropriate rule file and executes a Calibre nmDRC run to find pattern matches. The rule file is saved, enabling you to make edits if desired. You can invoke Calibre RVE at the end of the run to view the matches. ");
MGCAddSnippet(74, "You can open the Run Pattern Matching GUI from a Calibre layout viewer and run pattern matching on the open design. The tool builds the appropriate rule file and executes a Calibre nmDRC run to find pattern matches. The rule file is saved, enabling you to make edits if desired. You can invoke Calibre RVE at the end of the run to view the matches. ");
MGCAddSnippet(75, "You can use the Calibre Pattern Matching GUI to compile patterns into a DMACRO file for use in a Calibre pattern matching run.You can compile all patterns in the library or selected patterns.");
MGCAddSnippet(76, "You can export a pattern library to a graphical OASIS file using the Calibre Pattern Matching GUI. The OASIS file can be used to visualize patterns in layout format. The OASIS layout can also be used in a pattern matching run to validate the pattern library.");
MGCAddSnippet(77, "You can group similar patterns in a pattern library into a cluster using the Calibre Pattern Matching GUI. Clustering patterns is helpful for generalizing patterns; that is, grouping similar patterns together and determining minimum and maximum constraints that may apply to a group of patterns. You can also save a library in which each group of clustered patterns is represented by a pattern with constraints, thus reducing the number of patterns in the library. ");
MGCAddSnippet(78, "You can unfold the patterns in a library using the Calibre Pattern Matching GUI. Unfolding outputs a series of patterns without constraints. The output patterns are the result of applying the pattern constraints in various permutations.");
MGCAddSnippet(79, "You can create and edit patterns using the Calibre Pattern Matching GUI. You can also capture patterns from a layout that is open in a Calibre layout viewer. ");
MGCAddSnippet(80, "You can use the Pattern Matching GUI to add a new pattern to a pattern library. The drawing tools in the GUI are used to define pattern shapes.");
MGCAddSnippet(81, "The Calibre Pattern Matching GUI makes it easy to copy and paste patterns. ");
MGCAddSnippet(82, "You can capture a patterns from a layout using the Calibre Pattern Matching GUI. You can define the pattern capture area with a drawn rectangle, with polygons in the layout, with a mask layer, or with a hotspot layer.");
MGCAddSnippet(83, "You can manipulate the layers in a pattern using the Calibre Pattern Matching GUI. You can define pattern layers, extent layers, region layers, and marker layers using the GUI.");
MGCAddSnippet(84, "You can add marker layers to a pattern using the Calibre Pattern Matching GUI. When a pattern matching run is performed, the marker shapes are output to show where a match occurs. Patterns can have multiple markers of different types. ");
MGCAddSnippet(85, "You can add region layers to TEM patterns using the Calibre Pattern Matching GUI. Region layers define areas with special matching properties in a pattern. Region layers are not supported for BCM and XBAR patterns. ");
MGCAddSnippet(86, "You can add pattern layers to a library with the Calibre Pattern Matching GUI. ");
MGCAddSnippet(87, "You can create a custom or per-layer extent for a TEM pattern using the Calibre Pattern Matching GUI. Custom and per-layer extents enable more control over the region that is matched than is possible with the default extent.");
MGCAddSnippet(88, "You can add the results of a layer derivation to a pattern layer. The OR, AND, NOT, and XOR layer operations are supported. ");
MGCAddSnippet(89, "A layer mapping file is a text file that specifies the correspondence between layer names and layer numbers. You can load a layer mapping file when creating a new pattern library or for an existing library. ");
MGCAddSnippet(90, "The layer properties determine how the Calibre Pattern Matching GUI displays different layers. Layer properties can be set in the GUI and saved to a Calibre DESIGNrev layerprops file. You can load an existing layerprops file to set the layer properties used by the GUI. ");
MGCAddSnippet(91, "Constraints enable you to specify the distance an edge can shift and still be considered a match. They allow for variations in the pattern when Calibre searches for pattern matches. Constraint are added using the Calibre Pattern Matching GUI. ");
MGCAddSnippet(92, "Global constraints apply the same single edge constraint to all edges. For TEM patterns, you can apply a global constraint to all layers or to selected pattern layers. ");
MGCAddSnippet(93, "Single edge constraints specify the allowed movement for a single edge and are applied using the Calibre Pattern Matching GUI. You can add single edge constraints to TEM patterns and fixed extent BCM patterns. ");
MGCAddSnippet(94, "You can select multiple edges in a pattern and add the same single edge constraint to all of the selected edges. ");
MGCAddSnippet(95, "Edge to edge constraints in TEM patterns specify the maximum and minimum separation between two parallel edges, or a fixed separation. ");
MGCAddSnippet(96, "Edge to edge constraints in BCM1 patterns specify the allowed separation between two edges. The pattern extent changes as the edge separation changes. Constraints can only be added to single layer BCM patterns. ");
MGCAddSnippet(97, "Edge to edge constraints in BCM2 patterns specify the allowed separation between two edges. Constraints can only be added to single layer BCM patterns. ");
MGCAddSnippet(98, "Marker constraints specify the separation between a custom maker edge and a moving pattern edge. Marker constraints are only valid in TEM patterns. ");
MGCAddSnippet(99, "A dynamic extent is one that moves with a constrained pattern edge. You define a dynamic extent with the Calibre Pattern Matching GUI by adding an edge to edge constraint between a pattern edge and an edge of a custom extent. ");
MGCAddSnippet(100, "Relational constraints specify a relation between two edge to edge measurements. For example, two polygons may have variable widths, but require the same width for a successful pattern match. You can specify relational constraints in both TEM and BCM patterns. ");
MGCAddSnippet(101, "Edge to edge constraints are supported in multilayer BCM1 patterns, with some special requirements. In order to provide unambiguous matching, if constraints are applied between edges on the same layer (intra-layer constraints), that layer also needs to have at least one constraint applied to another layer (an inter-layer constraint). ");
MGCAddSnippet(102, "You can specify custom labels for constraints using the Calibre Pattern Matching GUI.");
MGCAddSnippet(103, "You can add properties, keys, comments, and attributes to the patterns in a library using the Calibre Pattern Matching GUI. ");
MGCAddSnippet(104, "You can add properties to a library using the Calibre Pattern Matching GUI. There are two types of properties: custom properties and output properties. All properties are automatically attached to the output markers for a matched result during a pattern matching run. ");
MGCAddSnippet(105, "You can assign property values to a pattern using the Calibre Pattern Matching GUI. Custom properties have a value defined in the pattern. Properties are automatically attached to the output markers for a matched result during a pattern matching run. ");
MGCAddSnippet(106, "You can add custom attributes to a library using the Calibre Pattern Matching GUI. There are two types of custom attributes: custom library attributes and custom pattern attributes. Attributes are only saved in the pattern library—they are not used in a pattern matching run and are not attached to pattern matching results. ");
MGCAddSnippet(107, "You can add custom attributes to a pattern using the Calibre Pattern Matching GUI. Custom attributes can be string or numeric values. Unlike properties, custom attributes are only saved in the pattern library. Custom attributes are not used in a pattern matching run and they are not attached to pattern matching results. You define the value of a custom pattern attributes in the pattern view of the GUI.");
MGCAddSnippet(108, "You can attach keys to patterns using the Calibre Pattern Matching GUI.  If key names are specified in the CMACRO option strings, then only patterns tagged with specified keys are used for matching.");
MGCAddSnippet(109, "You can set the pattern orientation attribute to specify which patterns orientations to match. The orientation is set on the Attributes tab of the Calibre Pattern Matching GUI. All orientations are selected by default.");
MGCAddSnippet(110, "You can attach comments to the patterns in library using the Calibre Pattern Matching GUI. ");
MGCAddSnippet(111, "You can capture and export pattern library files in batch mode using the DFM Pattern Capture SVRF command.");
MGCAddSnippet(112, "Calibre Pattern Matching runs as a set of SVRF operations enclosed in an SVRF DMACRO statement. The pattern matching SVRF DMACRO rule file is included in a standard Calibre rule file, which is then run with the standard Calibre invocation options.");
MGCAddSnippet(113, "You can add SVRF commands to your pattern matching rules file to generate output specific to pattern matching.");
MGCAddSnippet(114, "You can generate a pattern matching database (PMDB) for finding possible hotspots in your designs. This is done using an SVRF rule file that contains the DFM Pattern Capture statement. ");
MGCAddSnippet(115, "You can create an SVRF DMACRO from a pattern matching database (PMDB) file with the pdl_lib_mgr compile utility.");
MGCAddSnippet(116, "Calibre Pattern Matching uses a DMACRO definition to include pattern libraries in the SVRF rule file. The DMACRO is compiled from a pattern library (PMDB). ");
MGCAddSnippet(117, "The CMACRO command runs pattern matching on the specified DMACRO pattern library. CMACRO creates derived layer(s) containing the marker layer shapes generated from the pattern matching process. Runtime options are specified with an option string. ");
MGCAddSnippet(118, "A pattern matching rule file uses a CMACRO command to run pattern matching on a compiled DMACRO pattern library. The CMACRO creates derived layer(s) containing the marker shapes for each match. ");
MGCAddSnippet(119, "Calibre RVE is a graphical debug program that interfaces with most IC layout tools. You can use Calibre RVE to view your pattern matching results.");
MGCAddSnippet(120, "Partial matching identifies areas in a layout that match an input pattern within a given tolerance. If Calibre Pattern Matching does not report a match where expected, partial matching can help debug the problem. Partial matching applies only to exact TEM patterns. ");
MGCAddSnippet(121, "Partial matching identifies regions in a layout that match an input pattern within a given tolerance. Grid-based partial matching, or puzzle matching, divides the pattern into a grid of nine windows and the matching criteria is calculated on a per-window basis. A match candidate is located by exact match to at least one window, then a puzzle match is returned if a specified minimum number of windows match within a specified tolerance.");
MGCAddSnippet(122, "Partial matching can be used to debug a pattern that does not match where it is expected to match. Partial matching requires a pattern library compiled with appropriate options. Partial matching is specified with CMACRO options in the rule file. The output of a partial matching run is the per-layer XOR difference between the pattern layers and the design layers in the layout regions that meet the partial matching criteria. ");
MGCAddSnippet(123, "The Calibre Pattern Matching Reference Library (PMRL) flow enables you to efficiently compare a reference pattern library to patterns captured from a layout using the DFM Pattern Classify operation. ");
MGCAddSnippet(124, "The Pattern Matching Reference Library (PMRL) file is created from an existing pattern matching database (PMDB) library using the pdl_lib_mgr convert utility. The PMDB can be created using the DFM Pattern Classify or DFM Pattern Capture operations. The reference library is used in the PMRL flow to compare patterns in the reference library with patterns captured using the DFM Pattern Classify operation. ");
MGCAddSnippet(125, "The DFM Pattern Classify operation with the REFERENCE_LIB keyword compares patterns in a reference library to patterns captured from a layout. ");
MGCAddSnippet(126, "The pattern library manager utility can be used to manipulate and manage PMDB files.");
MGCAddSnippet(127, "The pdl_lib_mgr has several different command line options. ");
MGCAddSnippet(128, "Identifies similar patterns within a pattern library. Each pattern in the output pattern library includes a cluster property that identifies the cluster group the pattern belongs to. ");
MGCAddSnippet(129, "Compares pattern libraries and determines if any patterns are duplicated. Only exact patterns are compared. A log file with results is generated by default. Optionally, output pattern libraries can be generated that contain common or unique patterns. ");
MGCAddSnippet(130, "Generates an SVRF DMACRO file from the input pattern library. The DMACRO file is the compiled pattern library that is used in a pattern matching run. ");
MGCAddSnippet(131, "Generates new pattern matching libraries (PMDBs) from libraries created with older versions of the Calibre Pattern Matching tool or saves the library in the Pattern Matching Reference Library (PMRL) format. ");
MGCAddSnippet(132, "Generates a comma-separated values (CSV) file that contains the property values defined for each pattern in the input pattern library. ");
MGCAddSnippet(133, "Combines multiple pattern matching libraries (PMDBs) into a single PMDB library and removes duplicate patterns. If only one library is input, the command removes the duplicate patterns in that library. ");
MGCAddSnippet(134, "Opens the Tcl command-line interface to the Pattern Manager Library Utility, or executes a specified Tcl script.");
MGCAddSnippet(135, "Reads the patterns in a pattern matching library (PMDB) and outputs a series of patterns without constraints. The output patterns are the result of applying the pattern constraints in various permutations. Options control the number of output patterns and the edge movement between permutations. ");
MGCAddSnippet(136, "Generates an OASIS file including all polygon information from pattern layers. The utility can also generate PNG-formatted image files corresponding to each pattern in the library. ");
MGCAddSnippet(137, "Reports information about the input pattern library (PMDB).");
MGCAddSnippet(138, "Calibre MTflex functionality provides a parallel processing data architecture for running multithreaded Calibre tools on distributed networked computers. When you run pdl_lib_mgr cluster with Calibre MTflex functionality, Calibre creates hierarchical threads and runs these threads across the network to remote computers. Calibre MTflex is only supported for the cluster utility. ");
MGCAddSnippet(139, "Details on open source and third-party software that may be included with this product are available in the <your_software_installation_location>/legal directory.");

